        .then(res => {
            console.log(res);
        })
    }
    render(){
        return (
            <div className="container">
                <h4 className="center">Home</h4>
                <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. In error distinctio est. Impedit modi cumque neque dolor explicabo consequuntur officiis. Impedit reprehenderit quas officia vitae cum aspernatur voluptatum maiores possimus.</p>
            </div>
        )
    }
}

export default Home
